// import React from 'react';


import {Feature, Navbar} from './components';

import './App.css';

import React, { Component } from 'react';
import axios from 'axios';

class App extends Component {
  constructor() {
    super();
    this.responseData = null; // Initialize responseData to null
  }

  componentDidMount() {
    // Make a GET request to a Flask API endpoint
    console.log("test")
    axios.get('http://127.0.0.1:5000/api/data') // Replace with your actual API endpoint
      .then((response) => {
        this.responseData = response.data; // Set the response data in state
        console.log("data fetched from backend");
      })
      .catch((error) => {
        console.error('Error:', error);
      });
  }

  render() {
    this.componentDidMount(); // Get the response data from state
    console.log("test 2")
    return (
      <div>
        <div className = "row">
          <div className ="navbar">
            <Navbar />
          </div>
          <div className = "elements">
            <Feature />
          </div>
        </div>
        {this.responseData && (
          <div>
            <h2>Data from Flask:</h2>
            <pre>{JSON.stringify(this.responseData, null, 2)}</pre>
          </div>
        )}
      </div>
    );
  }
}

export default App;
